import React, { useEffect, useState } from "react";

function App() {
  const [backendData, setBackendData] = useState([{}]);

  useEffect(() => {
    fetch("/api")
      .then((response) => response.json())
      .then((data) => {
        setBackendData(data);
      });
  }, []);

  return 
  <div>

    {(typeof backendData.users === 'undefined') ? (<p>Loading...</p>): (backendData.users)}

  </div>;
}

export default App;
